:root {
  --theme-colour: cornflowerblue;
}

h1,
a,
strong {
  color: var(--theme-colour);
}

.img-bg {
  background-image: url("./assets/eat.jpg");
  background-size: cover;
  width: 200px;
  height: 50px;
}

.content {
  display: grid;
  grid-template-areas: "header header header" "navigation main ads" "footer footer footer";
  grid-template-columns: 150px 1fr 150px;
  grid-template-rows: minmax(60px, max-content) 1fr minmax(30px, max-content);
  min-height: 100vh;
}

.content .header,
.content .footer,
.content .main,
.content .left,
.content .right {
  padding: 13px;
}

.content .header {
  grid-area: header;
  background-color: #FFFF00;
  font-variant-caps: small-caps;
  font-variation-settings: normal;
}

.content .footer {
  grid-area: footer;
  background-color: #000;
  color: #FFF;
}

.content .main {
  grid-area: main;
  background-color: #D3D3D3;
}

.content .left {
  grid-area: navigation;
  background-color: #FF4500;
}

.content .left a {
  color: white;
  font-weight: bold;
}

.content .right {
  grid-area: ads;
  background-color: #FF4500;
}

.wrapper-grid {
  display: grid;
  grid-template-areas: "left right";
  grid-template-columns: 1fr 1fr;
}

.wrapper-grid.align-header {
  grid-auto-rows: 40px;
  align-items: center;
}

.wrapper-grid .wg-left {
  grid-area: left;
}

.wrapper-grid .wg-right {
  grid-area: right;
  text-align: right;
}

.news {
  color: green;
}

@media screen and (max-width: 768px) {
  .content {
    grid-template-areas: "header" "navigation" "main" "ads" "footer";
    grid-template-columns: 100%;
    grid-template-rows: minmax(30px, max-content) minmax(30px, max-content) 1fr minmax(30px, max-content) minmax(30px, max-content);
  }
}

